import React from "react";
import {  withRouter } from 'react-router-dom'
import {
  Card,
  CardHeader,
  CardBody,
  Container,
  Row,
  Col,
  Button,
  FormGroup,
  Input,
  Form
} from "reactstrap";
// core components
import Header from "components/Headers/Header.jsx";
import {connect} from "react-redux";
import {addExpense} from "../../redux/actions/expenseAction";
import configureStore from "../../redux/store";
import Global from "../../global";
import * as axios from "axios";
const {store} = configureStore();

let loggedUser;
var fecha = new Date();
      var mes = fecha.getMonth()+1;
      var dia = fecha.getDate();
      var ano = fecha.getFullYear();
      if(dia<10)
        dia='0'+dia; //agrega cero si es menor de 10
      if(mes<10)
        mes='0'+mes //agrega cero si es menor de 10
class AddExpense extends React.Component {
  state = {
    jobId: "",
    userId: "",
    date: ano+"-"+mes+"-"+dia,
    colorError: false
  };

  constructor(props) {
    super(props);
    const {auth} = store.getState();
    loggedUser = auth.userLogged
    this.selectRef = React.createRef();
  }

  componentDidMount() {
    this.setState({
      userId: loggedUser._id,
      jobs: this.props.jobs.filter(job => job.status === 'Approve'),
      category: '',
    })
  }

  handleInput = e => {
    e.persist()
    this.setState(prevState => ({
      ...prevState,
      [e.target.name]: e.target.value
    }))
  }

  uploadPhoto = async e => {
    const file = new FormData()
    file.append('photo', e.target.files[0])

    let img_ = null;
    try {
      const {data} = await axios.post(Global.url + 'v2/upload', file)
      img_ = data.img;
    }catch (e){
      img_ = 'notNet.png'
    }

    this.setState(prevState => ({ ...prevState, image:img_ }))
  }

  handleSubmit = async (e, props) => {
    const total =  this.state.total

    e.preventDefault()
    if (this.state.jobId==='') {
      alert('Select a Job to continue');
    }
    else if (this.state.category==='') {
      alert('Select a category to continue');
    }
    else if (!total.match(/^0|-?[0-9]\d*(\.\d+)?$/gm)){
      alert('Total quantity not valid')
    }
    else {
      this.setState({ colorError: false });
      this.props.addExpense(this.state)
      this.props.history.push('/admin/expenses')
    }
  }

  render() {
    if(!this.state.userId || this.state.userId==='') return <p>Loading</p>
    return (
      <>
        <Header forms={true}/>
        {/* Page content */}
        <Container className="mt--7" fluid>
          <Row className="mt-5">
            <Col className="mb-5 mb-xl-0" xl="12">
              <Card className="shadow">
                <CardHeader className="border-0">
                  <Row className="align-items-center">
                    <div className="col">
                      <h3 className="mb-0">Information Expense</h3>
                    </div>
                  </Row>
                </CardHeader>
                <CardBody>

                  <Form onSubmit={this.handleSubmit}>
                    <div className="pl-lg-4">
                      <Row>
                        <Col lg="6">
                          <FormGroup>
                          <label
                              className="form-control-label d-inline-block"
                              htmlFor="input-date">
                              Job Name *
                            </label>
                            <Input
                              ref={this.selectRef}
                              name="jobId"
                              className="form-control-alternative"
                              type="select"
                              onChange={this.handleInput}>
                            <option selected disabled>Select Job to Add Expense</option>
                            {this.state.jobs.map((e,i)=>{
                              return(
                                <option key={i} value={`${e._id}`}>{e.jobName}</option>)
                            })
                            }
                            </Input>
                          </FormGroup>
                          <FormGroup>
                            <label
                              className="form-control-label d-inline-block"
                              htmlFor="input-date">
                              Expense Date *
                            </label>
                            <Input
                              required
                              className="form-control-alternative"
                              placeholder="Select a date"
                              id="date"
                              name="date"
                              type="date"
                              value={this.state.date}
                              onChange={this.handleInput}
                            />
                          </FormGroup>
                          <FormGroup>
                            <label
                              className="form-control-label"
                              htmlFor="input-merchant">
                              Vendor
                            </label>
                            <Input
                              name="vendor"
                              className="form-control-alternative"
                              placeholder="Enter name of vendor"
                              type="text"
                              onChange={this.handleInput}
                            />
                          </FormGroup>

                          <FormGroup>
                            <label
                              className="form-control-label"
                              htmlFor="input-category"
                            >
                              Category *
                            </label>
                            <Input
                              required
                              name="category"
                              className="form-control-alternative"
                              placeholder="Enter a category"
                              type="select"
                              onChange={this.handleInput}
                            >
                            <option selected disabled >Choose One</option>
                            <option>Job Materials</option>
                            <option>Gas</option>
                            <option>Supplies</option>
                            <option>Sub Contractors</option>
                            </Input>
                          </FormGroup>
                          <FormGroup>
                            <label
                              className="form-control-label"
                              htmlFor="input-first-name"
                            >
                              Description
                            </label>
                            <Input
                              name="description"
                              className="form-control-alternative"
                              placeholder="Enter a description (optional)"
                              type="text"
                              onChange={this.handleInput}
                            />
                          </FormGroup>

                          <FormGroup>
                            <label
                              className="form-control-label"
                              htmlFor="input-last-name"
                            >
                              Image *
                            </label>
                            <Input
                              name="photo"
                              id="photo"
                              className="form-control-alternative"
                              placeholder="Select a photo"
                              type="file"
                              onChange={this.uploadPhoto}
                            />
                          </FormGroup>

                          <FormGroup>
                            <label
                              className="form-control-label"
                              htmlFor="input-first-name"
                            >
                              Total *
                            </label>
                            <Input
                              required
                              name="total"
                              className="form-control-alternative"
                              placeholder="Enter the total"
                              type="text"
                              onChange={this.handleInput}
                            />
                          </FormGroup>
                        </Col>
                        <Col lg="6">
                            <label
                              className="form-control-label"
                              htmlFor="input-first-name"
                            >
                              Image Preview
                            </label>
                          {this.state.image && <img width="100%" height="100%" src={this.state.image} alt="photo_url" />}
                          {this.state.image === 'notNet.png' &&<img width="100%" height="100%" src="data:image/png;base64," alt="photo_url" />}
                        </Col>
                      </Row>


                      <Row>
                        <Col lg="6">
                          <FormGroup>

                            <Button
                              disabled={this.state.image ? false : true}
                              className="form-control-alternative"
                              color="info"

                            >Save</Button>
                          </FormGroup>
                        </Col>
                      </Row>
                    </div>
                  </Form>
                </CardBody>
              </Card>
            </Col>

          </Row>
        </Container>
      </>
    );
  }
}


const mapStateToProps = state => ({
  jobs: state.job.jobs,
})

export default connect(mapStateToProps, {addExpense})(withRouter(AddExpense));
